import * as React from 'react';
import Button from '@mui/material/Button';
import TextField from '@mui/material/TextField';
import Box from '@mui/material/Box';
import Typography from '@mui/material/Typography';
import Container from '@mui/material/Container';
import { createTheme, ThemeProvider } from '@mui/material/styles';
import WebImage from '../componenet/WebImage';
import CatagoryBox from '../componenet/CatagoryBox';




const theme = createTheme({palette:
    {
        primary:{main:"#008000"},
        // secondary:{main:"yellow"}
    },
});

export default function Register() {
  const handleSubmit = (event) => {
    event.preventDefault();
    const data = new FormData(event.currentTarget);
    console.log({
      email: data.get('email'),
      password: data.get('password'),
    });
  };

  return (
    <ThemeProvider theme={theme}>
      <Container component="main" maxWidth="xs">
        <Box
          sx={{
            marginTop: 8,
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center',
          }}
        >

          <Typography component="h1" variant="h5">
          <WebImage alt="a decorative tree"/>
          </Typography>
          <Box component="form" onSubmit={handleSubmit} noValidate sx={{ mt: 1 }}>
          <TextField
              margin="normal"
              required
              fullWidth
              id="name"
              label="Your Name"
              name="name"
              autoComplete="name"
              autoFocus
            />
            <TextField
              margin="normal"
              required
              fullWidth
              id="email"
              label="Email Address"
              name="email"
              autoComplete="email"
              autoFocus
            />
            <TextField
              margin="normal"
              required
              fullWidth
              name="password"
              label="Password"
              type="password"
              id="password"
              autoComplete="current-password"
            />
            <CatagoryBox options = {method}></CatagoryBox>
            <CatagoryBox options = {topic}></CatagoryBox>
            <CatagoryBox options = {catagory}></CatagoryBox>
            <CatagoryBox options = {loction}></CatagoryBox>
            <Button
                onClick={handleSubmit}
              type="submit"
              fullWidth
              variant="contained"
              sx={{ mt: 3, mb: 2 ,color: 'white'}}
            >
              Register
            </Button>

          </Box>
        </Box>
      </Container>
    </ThemeProvider>
  );
}




//methods

const method = [
  "Anthropology",
  "Area Studies",
  "Art History",
  "Creative Writing",
  "Disability Studies",
  "Economics",
  "Ethnography",
  "Ethnohistory",
  "Gender Studies",
  "Genealogy",
  "Geography",
  "History",
  "Linguistics",
  "Literary Criticism",
  "Oral History",
  "Performance Studies",
  "Philosophy",
  "Political Science",
  "Psychology",
  "Public History",
  "Religious Studies",
  "Rhetoric/Communication",
  "Sociology",
  "Statistics",
  "Theology",
  "NA",
  ];
